//determine swap target
//Increase OR Decrease
LET $change := HASH_GET($eventargs, "Change"); 

LET $targetSortID := 
IF( 
  [Question Type] = "Category",
    "Group Sort ID", 
  "Question Sort ID"
);

LET $filter := 
  "[RecordID] <> " & DB_ENCODECONSTANT([RecordID]) & 
  " AND [LineNumber] = 1 AND [Question Type] " & IF([Question Type] = "Category", " = 'Category'", " <> 'Category'") & 
  " AND [Standard Questionnaire RecordID] =  " & DB_ENCODECONSTANT([Standard Questionnaire RecordID]) & 
  " AND [Question Category UUID] =  " & DB_ENCODECONSTANT([Question Category UUID]) & 
  IF( 
	[Question Type] <> "Category", 
	" AND [Question Group] =  " & DB_ENCODECONSTANT([Question Group])
  ) & 
  " AND [" & $targetSortID & "]" & IF($change = "Decrease", " < ", " > ") & DB_ENCODECONSTANT(EVALUATE("[" & $targetSortID & "]"))
;

LET $swapWith := 
DB_REPORT(
  ARRAY(
	"[RecordID]", 
    "[" & $targetSortID & "]"
  ), 
  "Standard Question", 
  $filter
);

LET $match := 
IF( 
  $change = "Decrease", 
  ARRAY_FIRST(ARRAY_SORTDESC($swapWith, $(item) ARRAY_INDEX($item, 2))), 
  ARRAY_FIRST(ARRAY_SORT($swapWith, $(item) ARRAY_INDEX($item, 2)))
);

RETURN 
HASH(
  "RecordID", ARRAY_FIRST($match), 
  "Sort ID", ARRAY_LAST($match), 
  "Change", HASH_GET($eventargs, "Change"), 
  "New ID", 
    ARRAY_LAST($match)
    //IF( 
	//  HASH_GET($eventargs, "Change") = "Decrease", 
	//  ARRAY_LAST($match) - 1, 
	//  ARRAY_LAST($match) + 1
    //)
)

IF( 
  [Question Type] = "Category", 

  //Change
  HASH_GET([Temp], "New ID"),

  //Do nothing
  [Group Sort ID]
)

IF( 
  [Question Type] = "Category", 

  //Do nothing
  0,

  //Change
  //COALESCE(HASH_GET([Temp], "Sort ID"), 1)

  HASH_GET([Temp], "New ID")  
	//COALESCE(HASH_GET([Temp], "Sort ID"), 1),
